import {createAsyncThunk } from '@reduxjs/toolkit';

// Define an asynchronous thunk for fetching data
export const fetchDailyOrders = createAsyncThunk('dailyOrders/fetchData', async () => {
  const response = await fetch('http://localhost:3010/dailyorders');
  const data = await response.json();
  return data[0];
});
